window.bookSummaryJSON = "<p><b>She refuses to be bound to anyone. He's trying to find freedom.</b></p> <p>Aileana is the king's pet. She has lived her entire life in a tower, waiting for the day she will be forced to marry his son. When that day arrives, she has a plan. Armed with her daggers and desire for freedom, she runs from the king and his deadly power.</p> <p>Xander has spent his entire life on the run. He doesn't need anyone or anything, certainly not a mate. But when his path crosses with a feisty elf, nothing will ever be the same again.</p> <p>He has secrets to keep. She wants to leave Ithenmyr behind and not look back. Fate has other plans for them both.</p> <p><i>This Rapunzel retelling is a slow burn, enemies-to-lovers, high fantasy romance filled with banter, fated mates, fake marriage, and world-building. </i>Of Earth and Flame <i>is book one in The Ithenmyr Chronicles, which ends in a series HEA. For mature listeners.</i></p>"; 
